import React from "react";
import Blog from "./Blog";

const Blogs = () => {
  const blog = [
    {
      id: 1,
      title: "this is our title",
      description: "this is our description for spacex",
    },
    {
      id: 2,
      title: "this is our title",
      description: "this is our description for spacex",
    },
    {
      id: 3,
      title: "this is our title",
      description: "this is our description for spacex",
    },
    {
      id: 4,
      title: "this is our title",
      description: "this is our description for spacex",
    },
  ];
  return (
    <div className="container">
        <div className="row">

      {blog.map((blogs) => {
        return (
            <div className="col-sm-6">
          <Blog
            title={blogs.title}
            description={blogs.description}
            key={blogs.id}
          />
          </div>
        );
      })}
      </div>
    </div>
  );
};

export default Blogs;
